CREATE DATABASE ERP_STAGE;

USE ERP_STAGE;

CREATE TABLE ST_CLIENTE(
	IDCLIENTE INT DEFAULT NULL,
	NOME VARCHAR(100) DEFAULT NULL,
	SEXO VARCHAR(20) DEFAULT NULL,
	NASCIMENTO DATE DEFAULT NULL,
	CIDADE VARCHAR(100) DEFAULT NULL,
	ESTADO VARCHAR(20) DEFAULT NULL,
	REGIAO VARCHAR(20) DEFAULT NULL,
	OPERACAO VARCHAR(10)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE DATABASE ERP_DW;

USE ERP_DW;

CREATE TABLE DIM_VENDEDOR(
	IDSK INT PRIMARY KEY AUTO_INCREMENT,
	IDVENDEDOR INT,
	INICIO DATETIME,
	FIM DATETIME,
	NOME VARCHAR(100),
	SEXO VARCHAR(20),
	IDGERENTE INT
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE DIM_NOTA(
	IDSK INT PRIMARY KEY AUTO_INCREMENT,
	IDNOTA INT
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE DIM_FORMA(
	IDSK INT PRIMARY KEY AUTO_INCREMENT,
	IDFORMA INT,
	FORMA VARCHAR(30)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE DIM_CLIENTE(
	IDSK INT PRIMARY KEY AUTO_INCREMENT,
	IDCLIENTE INT,
	INICIO DATETIME,
	FIM DATETIME,
	NOME VARCHAR(100),
	SEXO VARCHAR(20),
	EMAIL VARCHAR(50),
	NASCIMENTO DATE,
	CIDADE VARCHAR(100) DEFAULT NULL,
	ESTADO VARCHAR(20) DEFAULT NULL,
	REGIAO VARCHAR(20) DEFAULT NULL
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE DIM_CATEGORIA(
	IDCATEGORIA INT PRIMARY KEY,
	NOME VARCHAR(50)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE DIM_PRODUTO(
	IDSK INT PRIMARY KEY AUTO_INCREMENT,
	IDPRODUTO INT,
	INICIO DATETIME,
	FIM DATETIME,
	NOME VARCHAR(100),
	VALOR_UNITARIO DECIMAL(10,2),
	CUSTO_MEDIO DECIMAL(10,2),
	ID_CATEGORIA INT,
	FOREIGN KEY (ID_CATEGORIA) REFERENCES
	DIM_CATEGORIA(IDCATEGORIA)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE DIM_FORNECEDOR(
	IDSK INT PRIMARY KEY AUTO_INCREMENT,
	IDFORNECEDOR INT,
	INICIO DATETIME,
	FIM DATETIME,
	NOME VARCHAR(50)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE DIM_TEMPO(
	IDSK INT PRIMARY KEY AUTO_INCREMENT,
	DATA DATE,
	DIA CHAR(2),
	DIASEMANA VARCHAR(10),
	MES CHAR(2),
	NOMEMES VARCHAR(20),
	QUARTO TINYINT,
	NOMEQUARTO VARCHAR(20),
	ANO CHAR(4),
	ESTACAOANO VARCHAR(20),
	FIMSEMANA CHAR(3),
	DATACOMPLETA VARCHAR(10)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE FATO(
	IDNOTA INT REFERENCES DIM_NOTA(IDSK),
	IDCLIENTE INT REFERENCES DIM_CLIENTE (IDSK),
	IDVENDEDOR INT REFERENCES DIM_VENDEDOR (IDSK),
	IDFORMA INT REFERENCES DIM_FORMA (IDSK),
	IDPRODUTO INT REFERENCES DIM_PRODUTO (IDSK),
	IDFORNECEDOR INT REFERENCES DIM_FORNECEDOR (IDSK),
	IDTEMPO INT REFERENCES DIM_TEMPO (IDSK),
	QUANTIDADE INT,
	TOTAL_ITEM NUMERIC(10,2),
	CUSTO_TOTAL NUMERIC(10,2),
	LUCRO_TOTAL NUMERIC(10,2)
)ENGINE=InnoDB DEFAULT CHARSET=utf8;



